import EmployeesListItem from "../employees-list-item/employees-list-item";

import './employees-list.css';

const EmployeesList = () => {
    return (
        <ul className="app-list list-group">
            <EmployeesListItem name="Alex.P" salary={800}/>
            <EmployeesListItem name="Vladimir.S" salary={1200}/>
            <EmployeesListItem name="Phedor.T" salary={3000}/>
        </ul>
    )
}

export default EmployeesList;
